import React from 'react';

export const TrippleBanner = () => {
  return (
    <div className='addbaners'>
      <div className='row no-gutters'>
        <div className='col'>
          <div className='row no-gutters'>
            <div className='col-6'>
              <img src='image/addbanner/b1.jpg' className='img-fluid left' />
              <img src='image/addbanner/b2.jpg' className='img-fluid left' />
            </div>
            <div className='col-6'>
              <img src='image/addbanner/b3.jpg' className='img-fluid right' />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
